import React from "react";

function App() {
  return (
    <details className="m-4 p-4 border rounded bg-blue-100 w-2/6 duration-150 bg-stone-700 text-white cursor-pointer">
      <summary className="list-none flex justify-between">
        What can I watch on Netflix?
        <div className="border-8 border-transparent border-l-white mr-2"></div>
      </summary>
      <p>
        Netflix has an extensive library of feature films, documentaries, TV
        programmes, anime, award-winning Netflix originals and more. Watch as
        much as you want, anytime you want. <br />
        <br />
        <a href="">Check out some of our content</a>.
      </p>
    </details>
  );
}

export default App;
